import React, { useEffect } from 'react';
import {Grid} from 'semantic-ui-react';
import MemeCard from '../memeCard/memeCard';



const MemeList = ()=>{

    useEffect(()=>{
        fetch(encodeURI(`http://localhost:8080/memes`))
    }, [])

    return(
        <Grid>
            <MemeCard />
        </Grid>
    )

}

export default MemeList;
